    "quivira-national-wildlife-refuge-narrative-report-september-1-to-december-31-1960",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Quivira National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1960. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and reptiles- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, vegetation
    control, and prescribed fires. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, and violations.  N-R forms are attached.",nt"license_title":
